import React from "react";
import { Tabs, TabList, TabPanel, Tab } from "react-tabs";
import "react-tabs/style/react-tabs.css";
//import TodoInput from "./TodoInput";

export default function MyTabs() {
  return (
    <Tabs>
      <TabList className="mainpage">
        <Tab>Home</Tab>
        <Tab>Family</Tab>
        <Tab>Work</Tab>
        <Tab>Travel</Tab>
        <Tab>School</Tab>
      </TabList>

      <TabPanel>
        <div>
          <h4>Home ToDoo List</h4>
          //
          <TodoInput />
        </div>
      </TabPanel>
      <TabPanel>
        <div>Family ToDoo List</div>
      </TabPanel>
      <TabPanel>
        <div>Work ToDoo List</div>
      </TabPanel>
      <TabPanel>
        <div>Travel ToDoo List</div>
      </TabPanel>
      <TabPanel>
        <div>School ToDoo List</div>
      </TabPanel>
    </Tabs>
  );
}
